import React from "react";
import {render} from "react-dom";


export default class Score extends React.Component
{
    render()
    {
        const { scores } = this.props;

        return (
        <table className="style">
            <thead>
            <tr>
                <th>Nom</th>
                <th>score</th>
                <th>nb a trouver</th>
            </tr>
            </thead>
            <tbody>
            {scores.map((score, index) => {
                return (
                    <tr key={index}>
                        <td>{score.name}</td>
                        <td>{score.nbTry}</td>
                        <td>{score.nbToFind}</td>
                    </tr>
                );
            })}
            </tbody>
        </table>
        )
    }
}
